import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
export default function VolunteerRegistration(){
    const navigate = useNavigate();
    const [email, setEmail] = useState('');
    const [name, setName] = useState('');
    const [age, setAge] = useState('');
    const [address, setAddress] = useState('');
    const [phone, setPhone] = useState('');
    const [type, setType] = useState('');
    const [location, setLocation] = useState('');
    const [eventAssign, setEventAssign] = useState('');
    const [mon, setMon] = useState('');
    const [tues, setTues] = useState('');
    const [wed, setWed] = useState('');
    const [thurs, setThurs] = useState('');
    const [fri, setFri] = useState('');
    const [sat, setSat] = useState('');
    const [sun, setSun] = useState('');
    const [error, setError] = useState('');

    const handleSubmit = (event) => {
        navigate('/volhome')
    }

    return(
        <div className="login-wrapper">
            <h1>Administrator Log In Here</h1>
            <form onSubmit={handleSubmit}>
                <label>
                <p>Email <input type="text" onChange={e => setEmail(e.target.value)} /></p>
                </label>
                <label>
                <p>Name <input type="password" onChange={e => setName(e.target.value)} /></p>
                </label>
                <label>
                <p>Age <input type="password" onChange={e => setAge(e.target.value)} /></p>
                </label>
                <label>
                <p>Address <input type="password" onChange={e => setAddress(e.target.value)} /></p>
                </label>
                <label>
                <p>Phone <input type="password" onChange={e => setPhone(e.target.value)} /></p>
                </label>
                <label>
                <p>Type <input type="password" onChange={e => setType(e.target.value)} /></p>
                </label>
                <label>
                <p>Location <input type="password" onChange={e => setLocation(e.target.value)} /></p>
                </label>
                <label>
                    <p>Availability: </p>
                </label>
                <label>
                <p>Monday <input type="password" onChange={e => setMon(e.target.value)} /></p>
                </label>
                <label>
                <p>Tuesday <input type="password" onChange={e => setTues(e.target.value)} /></p>
                </label>
                <label>
                <p>Wednesday <input type="password" onChange={e => setWed(e.target.value)} /></p>
                </label>
                <label>
                <p>Thursday <input type="password" onChange={e => setThurs(e.target.value)} /></p>
                </label>
                <label>
                <p>Friday <input type="password" onChange={e => setFri(e.target.value)} /></p>
                </label>
                <label>
                <p>Saturday <input type="password" onChange={e => setSat(e.target.value)} /></p>
                </label>
                <label>
                <p>Sunday <input type="password" onChange={e => setSun(e.target.value)} /></p>
                </label>
                <div>
                <button type="submit">Submit</button>
                </div>
                {error && <div>{error}</div>}
            </form>

            <br />
            {/* <div>
                <button onClick={handleVolRegister}>Volunteer Registration</button>
                <button onClick={handleVolLogin}>Volunteer Login</button>
                <button onClick={handleAdminRegister}>Admin Registration</button>
            </div> */}
        </div>
    );
}
